import { defineService, implementService } from '@wix/services-definitions';
import { SignalsServiceDefinition, } from '@wix/services-definitions/core-services/signals';
export const InvoiceItemServiceDefinition = defineService('invoiceItem');
export const InvoiceItemService = implementService.withConfig()(InvoiceItemServiceDefinition, ({ getService, config }) => {
    const signalsService = getService(SignalsServiceDefinition);
    const invoiceItem = signalsService.signal(config.invoiceItem);
    return { invoiceItem };
});
